import React from "react";

import "./ImageContainer.css";

const ImageContainer = (po) => {
    return (
        <div className="col-lg-6 col-sm-12">
            <img src="../../images/My_photo.PNG" alt="Denis Ladychenko"/>
        </div>
    );
};


export default ImageContainer;
